(1, '<?php \r\nglobal $user;\r\n\r\n   if ($user->uid == 1) {\r\n     echo \'Styles Override\';\r\n  }\r\n\r\n?>\r\n\r\n<style>\r\n\r\n.valuecolor {\r\n    background-color: lime;  \r\n}\r\n\r\n* .error {display: none !important;}\r\n.filter-wrapper {display: none}\r\n#admin-menu-icon {display:none;}\r\n.view-picks-template .views-row, .view-shows .views-row, .field-name-field-matches > .field-items > .field-item { margin: 5px 0 0; border-bottom: 1px solid #ddd; }\r\n\r\n.field-name-og-user-node .field-label {\r\n    font-size: 24px;\r\n    color: #333;\r\n}\r\n\r\n.field-item a {\r\n    color: #0c59b1 !important;\r\n    padding-left: 13px;\r\n}\r\n\r\n* a.visited, td a, td a.visited, h3 a { color: #0c59b1 !important; }\r\n\r\n.views-field-group-access a {color: #d4180a !important;}\r\n\r\n.field-name-og-user-node .field-item a {\r\n   background: url(\'/sites/default/files/list.png\') left center / 20px auto no-repeat;\r\n   font-size: 16px;\r\n   padding-left: 25px;\r\n}\r\n\r\n.node-match .field-type-entityreference, .view-matches .views-field, .view-shows .views-field, .view-picks-template form > div {width:auto;}\r\n\r\ninput[type=\"submit\"] {\r\n    float: left;\r\n    clear: both;\r\n    margin: 10px 0;\r\n}\r\n#comments {\r\nfloat: left;\r\nwidth: 100%;\r\n}\r\n\r\naside {    \r\n    background: #f8f8f8;\r\n    border-radius: 5px;\r\n    -webkit-border-radius: 5px;\r\n}\r\n#breadcrumbs, .messages {float:left; width: 100%;}\r\nth a, th a.active { color: #fff !important;}\r\n.content a:visited {color:inherit;}\r\n\r\n.page-node #content-wrap img {\r\n    border: none;\r\n    padding: 0;\r\n    height: auto;\r\n    max-width: 97.4%;\r\n    margin: 0 0 0 4px;\r\n}\r\n\r\n.block-quicktabs {margin-top: 20px;}\r\n.quicktabs-wrapper ul {padding:0;}\r\n\r\n.quicktabs-wrapper .quicktabs-tabs li {\r\n    padding: 8px 12px 5px;\r\n    background: #eee;\r\n    margin-right: 1px;\r\n    display: block;\r\n    float: left;\r\n}\r\n\r\n.quicktabs-wrapper .quicktabs-tabs li.active { background: #0c59b1;}\r\n.quicktabs-wrapper .quicktabs-tabs li.active a {color:#fff;}\r\n\r\n#quicktabs-container-wrestlers {float:left; width: 100%;}\r\n\r\ndiv#mitb {\r\n    border: 2px solid #fff;\r\n    float: left;\r\n    width: 100%;\r\n    margin: 20px 0;\r\n    padding: 10px;\r\n    background: #fefefe;\r\n}\r\n\r\n#user-login-form > div > .item-list {\r\n    margin: 140px 0 0 0;\r\n}\r\n\r\n#user-login-form #edit-actions {\r\n    margin: -220px 0px 200px 10px;\r\n    padding: 0;\r\n}\r\n\r\n.view caption {\r\n    text-align: left;\r\n    font-size: 20px;\r\n    font-family: dosis;\r\n    color: #0c59b1;\r\n}\r\n\r\n#block-views-faq-block {\r\n    border-top: 2px solid;\r\n    margin-top: 30px;\r\n    padding: 10px 0 20px;\r\n}\r\n\r\n#block-views-faq-block h2 { font-size: 36px;}\r\n\r\n.views-accordion-header {\r\n    background: #f8f8f8;\r\n    border: 0;\r\n    font-family: \'Dosis\', sans-serif;\r\n}\r\n\r\n.views-accordion-header a {\r\n    color: #333 !important;\r\n}\r\n\r\n.ui-accordion-content {\r\n   border-color: #f8f8f8 !important; \r\n   font-family: \'Din\', sans-serif;\r\n}\r\n\r\n#block-views-faq-block .view-header {\r\n    top: 25px;\r\n    right: 0;\r\n    position: absolute;\r\n}\r\n\r\n#block-views-faq-block .view-header a {\r\n    background: #d4180a;\r\n    color: white !important;\r\n    padding: 10px 20px;\r\n    font-family: Dosis;\r\n    font-size: 16px;\r\n    border:0;\r\n}\r\n\r\n.view-wrestlers tr {background: #f8f8f8; }\r\n.view-wrestlers td {border:1px solid #fff !important;}\r\n.view-wrestlers td.views-field-field-image img {border-radius: 30px; -webkit-border-radius: 30px; width: 30px; }\r\n\r\n.view-wrestlers td.views-field-field-image {\r\n    padding: 0 !important;\r\n    text-align: center;\r\n    vertical-align: bottom;\r\n}\r\n\r\n.field-name-field-shows-to-pick > .field-items > .field-item {\r\n    padding: 10px;\r\n    background: #f8f8f8;\r\n    margin: 10px;\r\n    border-radius: 10px;\r\n    -webkit-border-radius: 10px;\r\n}\r\n\r\n.field-name-field-shows-to-pick .field-name-field-matches {\r\n    padding: 20px;\r\n    background: #fff;\r\n}\r\n\r\n.field-name-field-shows-to-pick .field-name-field-matches h2, .field-name-field-shows-to-pick .field-name-field-matches h2 a {\r\n    font-size: 24px !important;\r\n    text-shadow: 1px 1px 1px #aaa;\r\n}\r\n\r\nh2.big a {font-size: 46px;}\r\n\r\ndiv#block-views-a-picking-template-block {\r\n    background: #333;\r\n    color: #f8f8f8;\r\n    padding: 20px;\r\n    border-radius: 10px;\r\n}\r\n\r\ndiv#block-views-a-picking-template-block h2 {\r\n    font-size: 20px;\r\n    color: #b6d4f5;\r\n}\r\n\r\ndiv#block-views-a-picking-template-block .field-item h2 a { color: #b6d4f5 !important;}\r\n\r\ndiv#block-views-a-picking-template-block .field .field-label, div#block-views-a-picking-template-block label {\r\n    font-weight: bold;\r\n    color: #f77b72;\r\n    margin-right: 2px;\r\n}\r\n\r\ndiv#block-views-a-picking-template-block .node-match .field-type-entityreference { background-color: transparent; border:none; padding-right: 5% !important;}\r\n\r\n\r\n</style>\r\n\r\n<?php \r\n\r\n   if ($user->uid == 1) { ?>\r\n<style>\r\n/** admin styles **/\r\n.filter-wrapper {display:block;}\r\n#admin-menu-icon {display:block;}\r\n\r\n</style>\r\n<?php } ?>\r\n\r\n<?php \r\n\r\n   if ($user->uid == 0) { ?>\r\n<style>\r\n/** anonymous styles **/\r\n#mitb .mitb_row {display:none;}\r\n\r\n\r\n</style>\r\n<?php } ?>\r\n\r\n\r\n<!--\r\n<script>\r\n  function() {\r\n  if (!$(\'.toggle-enable\').hasClass(\'disabled\')) {\r\n    if (Drupal.ModuleFilter.jQueryIsNewer()) {\r\n      $checkbox.click();\r\n      $switch.toggleClass(\'off\');\r\n    } else {\r\n      $checkbox.click().change();\r\n      $switch.toggleClass(\'off\');\r\n    }\r\n  }\r\n}\r\n</script> -->\r\n\r\n', 'common styles', 'php_code'),
