INSERT INTO `field_revision_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'page', 0, 36, 36, 'und', 0, '<div class=\"clearfix\">\r\n  <h2>Phase #1</h2>\r\n  <iframe width=\"800\" height=\"450\" src=\"https://www.youtube.com/embed/1ihhEaR6aG4?rel=0&amp;controls=0&amp;showinfo=0&amp;start=600\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>\r\n</div>\r\n<hr>\r\n<div class=\"clearfix\">\r\n  <h2>Create Private Pool</h2>\r\n  <iframe width=\"800\" height=\"450\" src=\"https://www.youtube.com/embed/5rvZ6j54i5k?ecver=1\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>\r\n</div>\r\n<hr>\r\n<div class=\"clearfix\">\r\n  <h2>Create Public Pool</h2>\r\n  <iframe width=\"800\" height=\"450\" src=\"https://www.youtube.com/embed/7LjXGoeRP-g?rel=0&amp;showinfo=0&amp;ecver=1\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>\r\n</div>\r\n<hr>\r\n<?php \r\n  global $user;\r\n  if ($user->uid == 1) { ?>\r\n    <div class=\"clearfix\">\r\n     <h2>Publishing picks for Administrator</h2>\r\n     <iframe width=\"800\" height=\"450\" src=\"https://www.youtube.com/embed/bXknL49iu-w?ecver=1\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>\r\n    </div>\r\n<?php } ?>\r\n<hr>\r\n<?php \r\n  global $user;\r\n  if ($user->uid == 1) { ?>\r\n    <div class=\"clearfix\">\r\n     <h2>Creating Rumble Matches under the Show</h2>\r\n      <iframe width=\"800\" height=\"450\" src=\"https://www.youtube.com/embed/M0MKB1bOcVA?ecver=1\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen></iframe>\r\n    </div>\r\n<?php } ?>\r\n', '', 'php_code'),
('node', 'page', 0, 155, 155, 'und', 0, '<style>\r\n h1 {display:none;}\r\n</style>', '', 'php_code'),
('node', 'resource', 0, 304, 304, 'und', 0, '<p>This is a test to see how this works.</p>\r\n', '', 'filtered_html'),
('node', 'page', 0, 374, 374, 'und', 0, '<?php\r\n  global $user;\r\n  if (in_array(\'administrator\', array_values($user->roles))) { ?>\r\n    <div class=\"button box\"><a class=\"border\" href=\"/admin/structure/entity-type/wrestler/wrestler/add\">Add new wrestler</a></div>\r\n<?php  } ?>', '', 'php_code'),
